script: |
  super -f text -I q8623.spq | sort > q8623.out

inputs:
  - name: q8623.spq
    data: |
      SELECT col0 AS col2 FROM tab1 (FORMAT parquet) WHERE ( col2 + col0 * col0 ) NOT IN ( - col0 / col2 + - col1 + + col1 );
  - name: tab1

outputs:
  - name: q8623.out
    data: |
      3
      64
      80
